import { useState } from "react";

const Home = () => {

    const [name, setName] = useState('test1');

    const handleClick = () => {
        setName('test2');
    }

    return (
        <div className="home">
            <h2>HomePage</h2>
            <button onClick={handleClick}>test</button>
            <p>{ name }</p>
        </div>
    );
}
 
export default Home;
